import React from 'react';
import { SearchBar } from '../SearchBar/SearchBar';



export const Home = () => {
  return (
    <div>
      <div>
          <h3>Alfabeticos</h3>
          <select>
              <option value="asc">Asecendente</option>
              <option value="desc">Descendentes</option>
          </select>
          <h3>Peso</h3>
          <select>
              <option value="pesoAsc">Asecendente</option>
              <option value="pesoDesc">Descendentes</option>
          </select>
      </div>
    </div>
  );
};
